const ListOfSubjects = ({lesson, id}) =>
{
    return (
        <div>
            <p>{id}</p>
            <p>{lesson.start_time}</p>
            <p>{lesson.end_time}</p>
            <p>{lesson.class_name}</p>
            <p>{lesson.classroom}</p>
        </div>
    )
}

export default ListOfSubjects;
